
-- Одна из популярных СУБД это MySQL. Сайт, примером которой будет wikipedia. 

DROP DATABASE IF EXISTS wikipedia;
CREATE DATABASE wikipedia DEFAULT charset cp1251;
USE wikipedia;

DROP TABLE IF EXISTS users;
CREATE TABLE users (
	id BIGINT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY, 
    login VARCHAR(50) UNIQUE COMMENT 'Логин',
    email VARCHAR(120) UNIQUE COMMENT 'Почта',
 	password_hash VARCHAR(100) COMMENT 'Пароль',
 	created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);


DROP TABLE IF EXISTS `profiles`;
CREATE TABLE `profiles` (
	user_id BIGINT UNSIGNED NOT NULL UNIQUE,
    body LONGTEXT,
    FOREIGN KEY (user_id) REFERENCES users(id)
);



DROP TABLE IF EXISTS `donations`;
CREATE TABLE `donations` (
	admin_user_id BIGINT UNSIGNED NOT NULL UNIQUE,
    body LONGTEXT,
    FOREIGN KEY (admin_user_id) REFERENCES users(id)
);


DROP TABLE IF EXISTS photos;
CREATE TABLE photos(
	id SERIAL,
    user_id BIGINT UNSIGNED NOT NULL,
    filename VARCHAR(255),    	
    SIZE INT,
    created_at DATETIME DEFAULT NOW(),
    FOREIGN KEY (user_id) REFERENCES users(id)
);


DROP TABLE IF EXISTS article_categories;
CREATE TABLE article_categories (
	id SERIAL,
    name VARCHAR(255),
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME ON UPDATE CURRENT_TIMESTAMP
);


DROP TABLE IF EXISTS article;
CREATE TABLE article (
	id SERIAL,
	photo_id BIGINT UNSIGNED NOT NULL,
	categori_id BIGINT UNSIGNED NOT NULL,
	user_id BIGINT UNSIGNED NOT NULL,
	heading VARCHAR(255),
    body LONGTEXT,
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (categori_id) REFERENCES article_categories(id),
    FOREIGN KEY (photo_id) REFERENCES photos(id)
);  



DROP TABLE IF EXISTS `history_changing_articles`;
CREATE TABLE `history_changing_articles` (
	id SERIAL,
    `text` VARCHAR(255),
    created_at DATETIME DEFAULT NOW(),
    updated_at_id DATETIME ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (id) REFERENCES `article`(id)
);  




DROP TABLE IF EXISTS communities_categories;
CREATE TABLE communities_categories (
	id SERIAL,
    name VARCHAR(255),
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME ON UPDATE CURRENT_TIMESTAMP
);


DROP TABLE IF EXISTS communities;
CREATE TABLE communities(
	id SERIAL,
	name VARCHAR(150),
	categori_id BIGINT UNSIGNED NOT NULL,
	admin_user_id BIGINT UNSIGNED NOT NULL,
	body LONGTEXT,
	INDEX communities_name_idx(name),
	FOREIGN KEY (admin_user_id) REFERENCES users(id),
	FOREIGN KEY (categori_id) REFERENCES communities_categories(id)
);




DROP TABLE IF EXISTS users_communities;
CREATE TABLE users_communities(
	id SERIAL,
	user_id BIGINT UNSIGNED NOT NULL,
	body LONGTEXT,
	community_id BIGINT UNSIGNED NOT NULL,
	PRIMARY KEY (user_id, community_id),
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (community_id) REFERENCES communities(id)
);




-- прочитаем про пожертвование

SELECT body FROM donations ;

-- Находим пользователя
SELECT login, email FROM users WHERE id = 1;

-- Данные пользователя 
SELECT 
	login, 
	email, 
	(SELECT filename FROM photos WHERE user_id = 1 LIMIT 1) as photo,
	(SELECT body FROM profiles WHERE user_id = 1) as bp
FROM users 
WHERE id = 1;

-- Узнаем какие категории статей есть на сайте

SELECT name FROM article_categories ac ;

-- Выбираем статью которую написал пользователь

SELECT heading FROM article WHERE user_id = 1;

-- установим пользователя с id = 1 в качестве админа ко всем сообществам

