-- сколько статей у каждого пользователя?  

SELECT COUNT(id), user_id
  FROM article 
  GROUP BY user_id;

-- Подсчитаем, сколько собрали комментариев посты в  сообществах пользователя

SELECT COUNT(id) AS n
  FROM users_communities WHERE community_id IN (SELECT id FROM communities WHERE admin_user_id = 1);

-- Узнаем в каких категориях находится статьи пользователя

SELECT login,email,heading,name
  FROM article
    JOIN users ON article.user_id = users.id
    JOIN article_categories ON article_categories.id  = article.categori_id 
  WHERE users.id = 1;
 
-- Просмотр сообщества,категорий и коментарии пользователей

SELECT
	(SELECT login FROM users WHERE id = (SELECT id FROM communities WHERE id = 1)),
	users.login AS Users, 
	communities.name AS head,
	communities.body AS admin_text,
	communities_categories.name AS categori,
	users_communities.body AS users_text
  	FROM communities
    	JOIN communities_categories ON communities.categori_id = communities_categories.id
    	JOIN users_communities ON communities.id = users_communities.community_id 
    	JOIN users ON users_communities.user_id = users.id
  	WHERE communities.id = 1;
  	
  	
-- Представление на сортировку 

DROP VIEW IF EXISTS cat_art;
CREATE VIEW cat_art AS SELECT * FROM wikipedia.article_categories ac ORDER BY name;

SELECT * FROM wikipedia.cat_art;

