-- Представление для того чтобы узнать сколько статей в каждой теме

DROP VIEW IF EXISTS cat_art_2;
CREATE VIEW cat_art_2 AS SELECT
	COUNT(categori_id ) as nc,
	categori_id,
	name
FROM article 
	JOIN article_categories ON article.categori_id = article_categories.id 
GROUP BY categori_id;

SELECT * FROM wikipedia.cat_art_2;

-- Хранимая процедура для пользователей которым меньше 18

DROP PROCEDURE IF EXISTS all_users;

DELIMITER //

CREATE PROCEDURE all_users ()
BEGIN
	SELECT updated_at FROM users
	WHERE updated_at > DATE_SUB(CURRENT_TIMESTAMP() , INTERVAL 18 YEAR) 
	;
END//

DELIMITER ;

CALL all_users() ;

-- Процедура чтобы узнать данные о пользователей по id

DROP PROCEDURE IF EXISTS data_users;

DELIMITER //

CREATE PROCEDURE data_users (id_users BIGINT)
BEGIN
	SELECT login,email FROM users
	WHERE  id = id_users
	;
END//

DELIMITER ;

CALL data_users(1);

-- Триггер для пользователей которые хотят оставить null поля с данными login и email.

DROP TRIGGER IF EXISTS val_var;
DELIMITER //
CREATE TRIGGER val_var BEFORE INSERT ON users
FOR EACH ROW BEGIN
	IF NEW.login IS NULL OR NEW.email IS NULL THEN
	    SIGNAL SQLSTATE '45000'
	    SET MESSAGE_TEXT = 'Bad values';
	END IF;
END//

DELIMITER ;



-- Триггер для автозаполнение колонки categori_id

DROP TRIGGER IF EXISTS val_var;
DELIMITER //
CREATE TRIGGER val_var BEFORE INSERT ON article
FOR EACH ROW 
BEGIN
	DECLARE cat_id INT ;
	SELECT id INTO cat_id FROM article ORDER BY id LIMIT 1;
	SET NEW.categori_id = COALESCE(NEW.categori_id,cat_id);
END//

DELIMITER ;



SELECT * FROM article;
